import Create from './Create'

function Show(props){
    return(
    <p>{props.status}</p>
    );
}



function Add(props) {
    return (
        <div >
           <div style={{border: "double", padding:"10px"}}>
           <h2>{props.heading}</h2>
           <input type = "text" id = "name"/> <br/><br/>
           <button id ="button_create">Create Contact</button>
           <h3 id ="name_created"></h3>
           <script>
            var x = document.getElementById("name").value;
            document.getElementById("button_create").onclick = function() {create_func()};
            function create_func(){
                document.getElementById("name_created").innerHTML = x
            }

           </script>
           <p>------------------------------------------------------</p>
           </div>

           <div>
            <Show id = "asso_number" status = "Click a contact to view associated phone numbers"/>
            <Show id = "stat" status = "Show Stats"/>
           </div>

        </div>

    );
}

export default Add;
